-- ----------------------------
-- Table structure for t_cms_capfil
-- ----------------------------
DROP TABLE IF EXISTS `t_cms_capfil`;
CREATE TABLE `t_cms_capfil`  (
  `FIL_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '由对象存储生成的批量文件ID',
  `MERC_ID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户号',
  `ORIG_FIL_NM` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原始文件名',
  `MERC_USR_NO` bigint(20) NOT NULL COMMENT '商户用户号',
  `MERC_CNM` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户中文名称',
  `MERC_ABBR` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户简称',
  `BUS_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务类型,参见数据字典:BUS_TYP',
  `URG_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '加急标识: 1-加急，0-普通(不加急)',
  `IMP_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上传日期',
  `IMP_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上传时间',
  `IMP_OPR_NO` bigint(20) NOT NULL COMMENT '上传操作员(商户操作员的内部ID-USR_OPR_NO)',
  `IMP_OPR_NM_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上传操作员姓名(密文)',
  `IMP_OPR_NM_MASK` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上传操作员姓名(掩码)',
  `IMP_SYS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上传系统渠道',
  `IMP_BUS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上传业务渠道',
  `IMP_REQ_BUS_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上传统一跟踪流水号',
  `IMP_JRN_NO` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行上传操作的流水号',
  `IMP_FAL_CD` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '入库失败错误代码',
  `IMP_FAL_RSN` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '入库失败描述(例如：入库失败的描述)',
  `CAP_FIL_RMK` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户添加的文件备注描述,例如：“10月份工资\"',
  `CAP_FIL_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '文件状态：W0-正在入库，W1-等待(上传操作员)确认, A1-待审核, S1-审核通过,F1-审核拒绝,CX-已撤销(删除)，F3-入库失败(最终状态)',
  `BAT_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '入库后产生的批次号（由具体的业务平台生成，例如：代收付业务平台）',
  `TOT_NUM` bigint(20) NOT NULL COMMENT '文件中的明细笔数',
  `TOT_AMT` decimal(18, 2) NOT NULL COMMENT '总金额',
  `CFM_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '确认该批次的日期',
  `CFM_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '确认时间',
  `CFM_JRN_NO` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '确认流水号',
  `CFM_REQ_BUS_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行确认操作的统一跟踪号',
  `CFM_SYS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行确认操作的系统渠道(REQ_SYS_CNL)',
  `CFM_BUS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行确认操作的业务渠道',
  `CFM_OPR_NO` bigint(20) NOT NULL COMMENT '执行确认操作的操作员内部ID。',
  `CFM_OPR_NM_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行确认操作的操作员姓名(密文)',
  `CFM_OPR_NM_MASK` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行确认操作的操作员姓名(掩码)',
  `CXL_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '撤销日期',
  `CXL_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '撤销时间',
  `CXL_JRN_NO` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行撤销操作的流水号',
  `CXL_REQ_BUS_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行撤销操作统一跟踪号',
  `CXL_BUS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行撤销操作的业务受理渠道',
  `CXL_SYS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行撤销的系统渠道',
  `CXL_OPR_NO` bigint(20) NOT NULL COMMENT '执行撤销操作的商户操作员内部ID',
  `CXL_OPR_NM_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行撤销操作的商户操作员姓名(密文)',
  `CXL_OPR_NM_MASK` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行撤销操作的商户操作员姓名(掩码)',
  `RVW_OPR_NO` bigint(20) NOT NULL COMMENT '执行审核操作的商户操作员内部ID(USR_OPR_NO)',
  `RVW_OPR_NM_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行审核操作的商户操作员姓名(密文)',
  `RVW_OPR_NM_MASK` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行审核操作的商户操作员姓名(掩码)',
  `RVW_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行审核操作的日期',
  `RVW_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审核时间',
  `RVW_REQ_BUS_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '执行审核操作的系统统一跟踪号。',
  `RVW_JRN_NO` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审核流水号',
  `RVW_SYS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审核系统渠道',
  `RVW_BUS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审核业务渠道',
  `RVW_RMK` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审核时填写的文本信息（例如：审核原因）',
  `PUSH_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '人机交互（例如：审核、撤销）完成后，向目标系统（例如：代收付业务平台）推送通知的状态：U-未推送，S-推送成功，F-推送失败',
  `PUSH_FAL_CD` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '人机交互（例如：审核、确认）完成后，向目标系统（例如：代收付业务平台）推送通知的错误代码。',
  `PUSH_FAL_RSN` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '推送错误描述',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ',
  PRIMARY KEY (`FIL_ID`) USING BTREE,
  UNIQUE INDEX `T_MBS_CAPFIL_UI2`(`MERC_ID`, `ORIG_FIL_NM`) USING BTREE,
  UNIQUE INDEX `T_MBS_CAPFIL_PK`(`FIL_ID`) USING BTREE,
  INDEX `T_MBS_CAPFIL_NI1`(`CAP_FIL_STS`, `PUSH_STS`, `BUS_TYP`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '批量代发代扣批次审核信息,此处只是保留审核（含确认前）批次信息。' ROW_FORMAT = Dynamic;

