  INDEX `T_MBS_OPR_LOG_HIS_NI2`(`USR_NO`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商户操作员登录历史表，用于登记商户操作员的信息。' ROW_FORMAT = Dynamic;

